import "./ExpenseItem.css";

function ExpenseItem(prop) {


  return (
    <div className="expense-item">
    
      <div>{prop.date}</div>

      <div className="expense-item__description">
        <h2>{prop.title}</h2>
        <span className="expense-item__price">{prop.amount}</span>
      </div>
    </div>
  );
}

export default ExpenseItem;
